struct rview
uprop_get_dm(rune ch)
{
	static thread_local rune hack;
	struct rview rv =  stage2[stage1[ch / 64]][ch % 64];
	if (rv.p != nullptr)
		return rv;
	hack = ch;
	return (struct rview){&hack, 1};
}
